// import logo from './logo.svg';
import MyImage from './image/cat.jpg';
import './App.css';

function Cat() {
  return <h2>Hi, this is my Cat!</h2>;

}

function App() {
  return (
    <div className="App">

        <img src={MyImage} className="App-logo" alt="logo" />


        <Cat></Cat>


    </div>
  );
}

export default App;
